const User = ({userName,url}) =>{
    // const handleClick = ()=>{
    //     fetch('http://localhost:3000/logout')
    //     .then(res => res.json())
    //     .then(res => window.location = window.location)

    // }
    return (
        <div>
            < a
                href='http://localhost:3000/logout'
                style={{
                    position: 'absolute',
                    padding: '5px 10px',
                    height:'25px',
                    lineHeight: '25px',
                    borderRadius: '3px',
                    backgroundColor: 'white',
                    color: 'black',
                    bottom: '5%',
                    left: '5%',
                    textDecoration: 'none'


                }}
            ><img src={url} style={{
                width:'25px',
                height:'25px',
                borderRadius:'50%'
            }} />
            <span 
                style={{
                    color:'#4267b2',
                    height:'25px',
                    marginLeft:'10px',
                    marginBottom:'50px'



                }}
            >{userName}</span></a>
        </div>
    )
}

export default User;
